// ==UserScript==
// @name         WALL-E
// @namespace    https://cloud.xuepeiyou.com/
// @version      0.3
// @icon         data:image/jpeg;base64,
// @description  解放双手，审批人是本人时自动审批通过，脏活儿交给 WALL-E
// @author       choukin
// @match        https://cloud.xuepeiyou.com/*
// @run-at       document-start
// @grant        unsafeWindow
// @license MIT
// ==/UserScript==

const AUDITORURL = 'k8s/apiv3/plat/team/auditors/get';
const ROLE_ID = 'role_id=1';
const PEIYOU_ENV = 'xuepeiyouenv';

(function () {
  function getUserInfo() {
    const userInfo = JSON.parse(localStorage.getItem('userInfo'));
    return userInfo
  }
  const originSend = XMLHttpRequest.prototype.send
  XMLHttpRequest.prototype.send = function (body) {
    if (body) {
      try {
        const bodyObj = JSON.parse(body)
        if (bodyObj.env && bodyObj.env[0]) {
          localStorage.setItem(PEIYOU_ENV, bodyObj.env[0])
        }
        const userInfo = getUserInfo()
        const { auditors, test_type, gray_audit } = bodyObj
        if (test_type === 0 && gray_audit && auditors === userInfo.email) {
          bodyObj.gray_audit = false
          body = JSON.stringify(bodyObj)
        }
      } catch (e) {
      }
    }
    originSend.apply(this, arguments);
  }
  const originOpen = XMLHttpRequest.prototype.open;
  XMLHttpRequest.prototype.open = function (_, url) {
    try {
      const envstr = localStorage.getItem(PEIYOU_ENV)
      if (envstr === 'test' && url && url.indexOf(AUDITORURL) > -1 && url.indexOf(ROLE_ID) > -1) {
        this.addEventListener("readystatechange", function () {
          if (this.readyState === 4) {
            const res = JSON.parse(this.responseText);
            const userInfo = getUserInfo()
            const tempUser = JSON.parse(JSON.stringify(res.data.list[0]))
            tempUser.Email = userInfo.email
            tempUser.Name = userInfo.realname
            res.data.list.unshift(tempUser)
            // 当前 xhr 对象上定义 responseText
            Object.defineProperty(this, "responseText", {
              writable: true,
            });

            this.responseText = JSON.stringify(res);
          }
        });
      }
    } catch (e) {
      console.error(e)
    }

    originOpen.apply(this, arguments);
  };


})();